import React from 'react';
import {BrowseRouter, Route,Switch} from 'react-router-dom';
import Dashboard from "./components/Dashboard";


function Welcome(props) {
  return <h1>Welcome, {props.name}</h1>;
}

function App() {
  return (
    <div>
      <Welcome name="Daniel" />
    </div>
  );
}

export default App;
